import React, { useState } from 'react'

function Movement() {

    const [Movement,setMovement] = useState("Stop");


    return (
        window.addEventListener('keydown', (event) => {
            switch (event.key){
                case 'ArrowUp': {setMovement('Up')} break;
                case 'ArrowDown': {setMovement('Down')} break;
                case 'ArrowLeft': {setMovement('Left')} break;
                case 'ArrowRight': {setMovement('Right')} break;
            }
        })
    )
}

export default Movement
